class Solution:
    def minWindow(self, s: str, t: str) -> str:
        m = len(s)
        n = len(t)
        print(f"{m = }, {n = }")
        if m < n:
            return ""
        chars = dict()
        for ch in t:
            if ch in chars:
                chars[ch] += 1
            else:
                chars[ch] = 1

        def matchStr(chars:dict[str, int], start: int, minLength: int) -> (int, int, str):
            charsCopy = dict(chars)
            endEnd = min(start + minLength, m)
            print(f"{charsCopy = }, {start = }, {endEnd = }")
            if s[start] in charsCopy:
                charRemoved = s[start]
                charsCopy[s[start]] -= 1
                if charsCopy[s[start]] == 0:
                    del charsCopy[s[start]]
                    if len(charsCopy) == 0:
                        return (start + 1, s[start])
                end = start + 1
                while end < endEnd:
                    if s[end] in charsCopy:
                        charsCopy[s[end]] -= 1
                        if charsCopy[s[end]] == 0:
                            del charsCopy[s[end]]
                            if len(charsCopy) == 0:
                                return (start + 1, s[start:end+1])
                    end += 1
                return (start + 1, None)
            else:
                return (start + 1, None)

        start, minStr, minLength = 0, None, m
        while start <= m - n:
            (start, minCand) = matchStr(chars, start, minLength)
            if minCand != None:
                print(f"{start = }, {minCand = }, {len(minCand) = }")
                minStr = minCand if minStr == None or len(minCand) < len(minStr) else minStr
                minLength = min(minLength, len(minCand))
        if minStr != None:
            return minStr
        return ""

sol = Solution()
s = ""
t = ""
sol.minWindow(s, t)